import React from "react";
import "./Join.css";
import logo from './favicon.png';
import { NavLink } from "react-router-dom";

function Join() {
    
  return (
    <div className="joinPage">
      <div className="Container">
        <img  src={logo} />
        <h1> Chat Application  </h1>
        <input type="text" name="" id="joininput" />
        <NavLink to='/Chat'><button className="btn"> Login </button></NavLink> 
      </div>
    </div>
  );
}

export default Join;
